fn bench(c: &mut Criterion) {
    let mut group = c.benchmark_group("Comparison");
    for (dim, data) in [
        (15, ARR_15.as_slice()),
        (30, ARR_30.as_slice()),
        (60, ARR_60.as_slice()),
        (120, ARR_120.as_slice()),
        (240, ARR_240.as_slice()),
    ]
    .iter()
    {
        group.bench_with_input(BenchmarkId::new("Quadratic", dim), data, |b, data| {
            b.iter(|| matrix_challenge_quadratic(*data))
        });
        group.bench_with_input(BenchmarkId::new("Linear", dim), data, |b, data| {
            b.iter(|| matrix_challenge_linear(*data))
        });
        group.bench_with_input(
            BenchmarkId::new("Quadratic Parallel", dim),
            data,
            |b, data| b.iter(|| matrix_challenge_quad_par(*data)),
        );
    }
    group.finish();
}

criterion_group!(benches, bench);
criterion_main!(benches);
